Britney recorded three songs with T-Pain, only one (that he wrote and did not produce) was released (&quot;Hot As Ice&quot;) and was produced by Danja. The two unreleased songs he collaborated on with her and produced are titled &quot;Boyfriend&quot; and &quot;One Of A Kind.&quot;  

 &quot;They are rebellious songs,&quot; says T-Pain, 20, born Faheem Najim. &quot;It's her letting everybody know she doesn't care about all the crap going on in the media.&quot;

